"use strict";

function f_gold(bloomDay, m, k) {
    if (m * k > bloomDay.length) {
        return -1;
    }
    function check(day) {
        let cnt = 0, cur = 0;
        for (let i = 0; i < bloomDay.length; i++) {
            cur = bloomDay[i] <= day ? cur + 1 : 0;
            if (cur === k) {
                cnt += 1;
                cur = 0;
            }
        }
        return cnt >= m;
    }
    let left = Math.min(...bloomDay), right = Math.max(...bloomDay);
    while (left < right) {
        let mid = (left + right) >> 1;
        if (check(mid)) {
            right = mid;
        } else {
            left = mid + 1;
        }
    }
    return left;
}
